import React, {Component} from "react";
import SearchWrapper from "./layouts/SearchWrapper";
import Header from "./layouts/Header";
import BannerOne from "./layouts/BannerOne";
import Features from "./layouts/Features";
import AboutArea from "./layouts/AboutArea";
import HowCanHelpTwo from "./layouts/HowCanHelpTwo";
import ServiceArea from "./layouts/ServiceArea";
import WhyChooseUs from "./layouts/WhyChooseUs";
import RecentProducts from "./layouts/RecentProducts";
import Team from "./layouts/Team";
import Cta from "./layouts/Cta";
import Testimonials from "./layouts/Testimonials";
import BlogArea from "./layouts/BlogArea";
import Brands from "./layouts/Brands";
import Footer from "./layouts/Footer";

/* -- biz9 import start -- */
//import Authentication from '../authentication';
//import AlertMessage from '../alertMessage';
import {Global} from "./../constant.js";
import {Remote} from "biz9-react-remote";
import {DataItem,DataType,Url,BiZ_Url,CMS,TemplateType} from "biz9-logic";
import {Log,Number,Str} from "biz9-utility";
import {UrlQuery} from "biz9-react-utility";
/* -- biz9 import start -- */

class HomeOne extends Component {
    constructor(props) {
        super(props);
        this.state = {
            template: DataItem.get_new(DataType.DT_TEMPLATE,0),
            values: {title:'my freadking title'},
        };
    }

    componentWillMount() {
        this.get_data();
    }
    async get_data() {
        let cloud_url = BiZ_Url.get_template(Global,TemplateType.PRIMARY);
        let [error,data] = await Remote.get(cloud_url);
        //this.setState({template:data.template});
        this.setState({values:data.page.section_1.items});
        //this.setState({page:{title:'my freadking title 22'}});
        Log.w('cloud_url',cloud_url);
        Log.w('data',data);
        Log.w('data_template',data.template);
    };

    render() {
        return (
            <>
                <SearchWrapper />
            {this.state.page.title}
                <Header page={this.state.page} />
                <BannerOne />
                <Features />
                <AboutArea design={'home_1'} />
                <HowCanHelpTwo />
                <ServiceArea background={true} />
                <WhyChooseUs />
                <RecentProducts />
                <Team />
                <Cta />
                <Testimonials design={'home_1'} />
                <BlogArea />
                <Brands />
                <Footer />
            </>
        );
    }
}

export default HomeOne;
